import React, { ReactElement } from "react";
import styled from "styled-components/native";

interface Props {}

export default function Home({}: Props): ReactElement {
  return (
    <Styled.container>
      <Styled.heading>Helo</Styled.heading>
    </Styled.container>
  );
}

const Styled = {
  container: styled.View``,
  heading: styled.Text``,
};
